def __len__(self):
        return self.getNumButtons()

    def enable(self):
        self.nodePath.reparentTo(self._base.dataRoot)

    def disable(self):
        self.nodePath.reparentTo(self._base.dataUnused)

    def getName(self):
        return self.name

    def getNodePath(self):
        return self.nodePath

    def __repr__(self):
        string = self.name + ': '
        for val in self:
            string = string + '%d' % val + ' '
        return string
